measurements.description:
Three flat flowers on one inflorescence, two buds on one immature inflorescence; 
	sepals cream overlaid lavender;
	petals cream overlaid lavender, veined darker distally, upper margins ruffled;
	lip ruffled, cream overlaid lavender, blotched yellow centrally, darker lavender striations distal tip;
	column light lavender, anther cap white;
	substance firm; texture diamond dust.
